import img1 from './pattal/arun1.jpg'
import img2 from './pattal/arun2.jpg'
import img3 from './pattal/arun3.jpg'
import img4 from './pattal/arun4.jpg'
import img5 from './pattal/arun5.jpg'
import img6 from './pattal/arun6.jpg'
import img7 from './pattal/arun7.jpg'
import img8 from './pattal/arun8.jpg'
import img9 from './pattal/arun9.jpg'
import img10 from './pattal/arun-10.jpg'
import img11 from './pattal/arun-11.jpg'
import img12 from './pattal/arun-12.jpg'
import img13 from './pattal/arun-13.jpg'


const images=[{img1},{img2},{img3},{img4},{img5},{img6},{img7},{img8},{img9},{img10},{img11},{img12},{img13}]
export default function Arun() {
  return (

    <div style={{ width: '80%', height: '300px', display: 'flex', flexWrap: 'wrap', gap: '10px' }}>
      {images.map((imgSrc, index) => (
        <img
          src={imgSrc}
          key={index}
          alt={`Pattal ${index + 1}`}
          style={{ width: '200px', height: 'auto', objectFit: 'cover' }}
        />
      ))}
    </div>

  )
}
